import React, { Component } from 'react';
import { Card, Row, Col, Container, Form, Button, Breadcrumb } from 'react-bootstrap';
import student from '../assets/student.png';
import teacher from '../assets/professor.png';
import parent from '../assets/family.png';
import schedule from '../assets/calendar.png';

import './Profile.css';

export default class Profile extends Component {
    render() {
        return (
            <div>
                <main role="main" className="inner cover">
                    <Row>
                        <Col><Card.Img variant="top" src="holder.js/100px160" />
    <Card.Body>
      <Card.Title>Card title</Card.Title>
      <Card.Text>
        This is a wider card with supporting text below as a natural lead-in to
        additional content. This content is a little bit longer.
      </Card.Text>
    </Card.Body>

                        </Col>
                        <Col>
                        </Col>
                        <Col>
                        </Col>
                        <Col>
                        </Col>
                    </Row>
                </main>
            </div>
        )
    }
}
